<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset1="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>I am iframe</title>
</head>
<body>
  I am iframe 111111
</body>
<script>
  var set1 = new Set();
var objects1 = [
    eval,
    isFinite,
    isNaN,
    parseFloat,
    parseInt,
    decodeURI,
    decodeURIComponent,
    encodeURI,
    encodeURIComponent,
    Array,
    Date,
    RegExp,
    Promise,
    Proxy,
    Map,
    WeakMap,
    Set,
    WeakSet,
    Function,
    Boolean,
    String,
    Number,
    Symbol,
    Object,
    Error,
    EvalError,
    RangeError,
    ReferenceError,
    SyntaxError,
    TypeError,
    URIError,
    ArrayBuffer,
    SharedArrayBuffer,
    DataView,
    Float32Array,
    Float64Array,
    Int8Array,
    Int16Array,
    Int32Array,
    Uint8Array,
    Uint16Array,
    Uint32Array,
    Uint8ClampedArray,
    Atomics,
    JSON,
    Math,
    Reflect];
objects1.forEach(o => set1.add(o));

for(var i = 0; i < objects1.length; i++) {
    var o = objects1[i]
    for(var p of Object.getOwnPropertyNames(o)) {
        var d = Object.getOwnPropertyDescriptor(o, p)
        if( (d.value !== null && typeof d.value === "object") || (typeof d.value === "function"))
            if(!set1.has(d.value))
                set1.add(d.value), objects1.push(d.value);
        if( d.get )
            if(!set1.has(d.get))
                set1.add(d.get), objects1.push(d.get);
        if( d.set1 )
            if(!set1.has(d.set1))
                set1.add(d.set1), objects1.push(d.set1);
    }
}
console.log('set1', set1);
</script>
</html>
